import '../App.scss';
import Title from '../components/title';

function ForParents() {
  return (
    <div className="for-parents">
      <section className="top-section-homepage">
         <div className="idziennik light"><a href="https://adfs.eduportal.koszalin.pl" ><Title title="iDziennik"  underline="darkblue" text="white" /></a></div>
         <div className="parents-union dark"><a href="/wip"><Title title="Parents Union" underline="lightblue" text="white" /></a></div>
         <div className="colum-right" >
         <div className="school-housing light"><a href="/specializations"><Title title="School Housing" underline="darkblue" text="white" /></a></div>
         <div className="contact contact-parents dark"><a href="/https://portal.eduportal.koszalin.pl/jst/koszalin/CMS/nabor-k.aspx" ><Title title="Contact Us" underline="lightblue" text="white" />
            <div className="contact-container"> 
              <p>Zespół Szkół nr 10 im. Bolesława Chrobrego w Koszalinie</p>
              <strong>ul. Gnieźnieńska 8<br/>75-736 Koszalin<br />tel. 94 342 28 61<br />e-mail:<br/> sekretariat@samochodowka.koszalin.pl</strong>
              <img src={`${process.env.PUBLIC_URL}/assets/logo-white.png`} alt="icon of a carwhite" /> 
          </div></a></div>
          </div>
     </section>
    </div>
  );
}

export default ForParents;
